import React from 'react';
// import useAxios from 'axios-hooks';
import {
  TextField, Grid, Typography, InputBase, makeStyles, fade,
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  paper: {
    backgroundColor: '#ffffff',

    display: 'flex',
    flexWrap: 'wrap',
    borderRadius: '40px',
    '& > *': {
      margin: theme.spacing(40),
      width: theme.spacing(50),
      height: theme.spacing(10),
    },
  },
  font: {
    fontSize: 30,

  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginRight: theme.spacing(2),
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(3),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
}));
export default function SharedPage(): JSX.Element {
  // const [{ data }, reload] = useAxios(
  //   { url: 'http://localhost:3000/room', method: 'POST' },
  // );
  const classes = useStyles();
  return (

    <Grid container>
      <Grid item xs={12} style={{ paddingBottom: 30, position: 'relative' }}>
        <Typography style={{ fontSize: 30 }}>
          판매 하기
        </Typography>
      </Grid>

      <Grid item xs={3} style={{ paddingBottom: 30, justifyContent: 'left' }}>
        <Typography style={{ fontSize: 30 }}>
          판매할 책
        </Typography>
      </Grid>
      <Grid item xs={9} style={{ paddingBottom: 30, justifyContent: 'left' }}>
        <div className={classes.search}>
          <div className={classes.searchIcon}>
            <img src="/i_search@3x.png" alt="search" />
          </div>
          <InputBase
            placeholder="Search…"
            classes={{
              root: classes.inputRoot,
              input: classes.inputInput,
            }}
            inputProps={{ 'aria-label': 'search' }}
          />
        </div>
      </Grid>
      <Grid item xs={12}>
        <TextField
          id="outlined-multiline-static"
          style={{ width: '100%' }}
          multiline
          rows={6}
          defaultValue="Default Value"
          variant="outlined"
          fullWidth
        />
        {/* <input id="outlined" style={{ width: '100%' }} /> */}
      </Grid>
    </Grid>
  );
}
